import './App.css';
import { useEffect } from 'react';

function App() {
  useEffect(() => {
    fetch('/time').then(res => res.json()).then(data => {
      setCurrentTime(data.time);
    });
  }, []);
  fetch("/test").then(res => res.text()).then(data => console.log("This is the data:" + data));
  return (
    <div className="App">
      <header>
        <img src="TextBlock_LogoDark.png" alt="Logo"/>
        <a href="aboutus">About Us</a>
        <a href="howitworks">How It Works</a>
        <a href="faqs">FAQs</a>
        <a className="button-link" href="login">Login</a>
        <a className="button-link" href="signup">Sign Up</a>
      </header>
      <main>
        <h1>Quickly Create & Organize Documents With Module Text Blocks.</h1>
        <h2>A smarter way to build, organize, and refine your documents - flexible, efficient, and intuitive.</h2>
        <a className="button-link" href="signup">Get Started</a>
      </main>
    </div>
  );
}

export default App;
